import React, { useState, useEffect } from 'react';

const SearchResults = (props) => {
    const {searchResults} = props;
    let resultsMap = Object.keys(searchResults);

    console.log(searchResults);
    return <div id ="results">{resultsMap.map((key)=> {return <><div>{JSON.stringify(searchResults[key].title)}</div><div>  {searchResults[key].primaryimageurl ? <img src={ searchResults[key].primaryimageurl } alt={ searchResults[key].description } /> : null}</div> </>})}</div>
}

export default SearchResults
